import React, { Component } from "react";

const NavBar = () => {
  return (
    <nav className="navbar navbar-light bg-light">
      <a className="navbar-brand" href="#">
        NavBar
        <span className="badge badge-pill badge-secondary">
          {this.props.size}
        </span>
      </a>
    </nav>
  );
};

export default NavBar;
